INSERT INTO `v1_4492fd2621cc20c0058a30b274bccf39d8c2159e915e2a01b8893ff78bfbd520` VALUES (1, "2030/12/17 14:59:59", 24, 10040, 102601, 0, 24001, 0.0, 0.0, "あたしだって\nやるときはやるよ！", "リン", "2020/04/30 12:00:00", 1, 0.0);
INSERT INTO `v1_4492fd2621cc20c0058a30b274bccf39d8c2159e915e2a01b8893ff78bfbd520` VALUES (1, "2030/12/17 14:59:59", 24, 10040, 102601, 1, 24002, 0.0, 0.0, "ふぅ…\nこれであたしの仕事は\n終わりだね", "リン", "2020/04/30 12:00:00", 1, 0.0);
INSERT INTO `v1_4492fd2621cc20c0058a30b274bccf39d8c2159e915e2a01b8893ff78bfbd520` VALUES (1, "2030/12/17 14:59:59", 24, 10040, 102601, 2, 24003, 0.0, 0.0, "終わった終わった\n一人でもなんとか\nなるもんだね", "リン", "2020/04/30 12:00:00", 1, 0.0);
INSERT INTO `v1_4492fd2621cc20c0058a30b274bccf39d8c2159e915e2a01b8893ff78bfbd520` VALUES (2, "2030/12/17 14:59:59", 24, 10040, 102601, 3, 24004, 0.0, 0.0, "やったね！\nこれでようやく\nサボれるよ…", "リン", "2020/04/30 12:00:00", 2, 0.0);
INSERT INTO `v1_4492fd2621cc20c0058a30b274bccf39d8c2159e915e2a01b8893ff78bfbd520` VALUES (1, "2030/12/17 14:59:59", 24, 10040, 102601, 4, 24005, 0.0, 0.0, "チーズが欲しいなら\nきちんと働いて\n買いに来なよ", "リン", "2020/04/30 12:00:00", 1, 0.0);
INSERT INTO `v1_4492fd2621cc20c0058a30b274bccf39d8c2159e915e2a01b8893ff78bfbd520` VALUES (2, "2030/12/17 14:59:59", 24, 10040, 102601, 5, 24006, 0.0, 0.0, "あたしを敵に回した\n恐ろしさ\n思い知ったか！", "リン", "2020/04/30 12:00:00", 2, 0.0);
INSERT INTO `v1_4492fd2621cc20c0058a30b274bccf39d8c2159e915e2a01b8893ff78bfbd520` VALUES (2, "2030/12/17 14:59:59", 24, 10040, 102601, 6, 24007, 0.0, 0.0, "あたしも意外と\nやるもんでしょ？", "リン", "2020/04/30 12:00:00", 2, 0.0);
INSERT INTO `v1_4492fd2621cc20c0058a30b274bccf39d8c2159e915e2a01b8893ff78bfbd520` VALUES (4, "2030/12/17 14:59:59", 24, 10040, 102601, 7, 24008, 0.0, 0.0, "疲れた…\nねずみの逃げ足\n速すぎるよ…", "リン", "2020/04/30 12:00:00", 4, 0.0);
INSERT INTO `v1_4492fd2621cc20c0058a30b274bccf39d8c2159e915e2a01b8893ff78bfbd520` VALUES (4, "2030/12/17 14:59:59", 24, 10040, 102601, 8, 24009, 0.0, 0.0, "このままじゃ\nまっひ～に\n叱られちゃうよ", "リン", "2020/04/30 12:00:00", 4, 0.0);
INSERT INTO `v1_4492fd2621cc20c0058a30b274bccf39d8c2159e915e2a01b8893ff78bfbd520` VALUES (4, "2030/12/17 14:59:59", 24, 10040, 102601, 9, 24010, 0.0, 0.0, "まじめに\nやったんだけどな…\n悔しいな～", "リン", "2020/04/30 12:00:00", 4, 0.0);
INSERT INTO `v1_4492fd2621cc20c0058a30b274bccf39d8c2159e915e2a01b8893ff78bfbd520` VALUES (4, "2030/12/17 14:59:59", 24, 10040, 102601, 10, 24011, 0.0, 0.0, "やられた…\nねずみって意外と\nてごわいね", "リン", "2020/04/30 12:00:00", 4, 0.0);
INSERT INTO `v1_4492fd2621cc20c0058a30b274bccf39d8c2159e915e2a01b8893ff78bfbd520` VALUES (4, "2030/12/17 14:59:59", 24, 10040, 102601, 11, 24012, 0.0, 0.0, "おのれ～\nあたしのチーズを\n盗みやがって～！", "リン", "2020/04/30 12:00:00", 4, 0.0);
INSERT INTO `v1_4492fd2621cc20c0058a30b274bccf39d8c2159e915e2a01b8893ff78bfbd520` VALUES (1, "2030/12/17 14:59:59", 24, 10040, 102601, 12, 24013, 0.0, 0.0, "疲れた…\nけど、次こそは\n守り抜くよ…", "リン", "2020/04/30 12:00:00", 4, 1.81);
